//Linear regresion on index and log returns
let sumY = 0
let sumX = 0
let sumXY = 0
let sumX2 = 0
let sumY2 = 0

for (var i = 1; i < len; i++) {
	sumY += Math.log(variable.closeArray[i] / variable.closeArray[i - 1])
	sumX += i
	sumXY += Math.log(variable.closeArray[i] / variable.closeArray[i - 1]) * i
	sumY2 += Math.pow(Math.log(variable.closeArray[i] / variable.closeArray[i - 1]), 2)
	sumX2 += Math.pow(i, 2)
}

//Slope
let slope = ((len * sumXY) - sumX*sumY) / ((len * sumX2) - Math.pow(sumX, 2))

//Intercept
let intercept = ((sumY - slope*sumX) / len)

//Linear regression function
let Y = slope * len + intercept

//Sum of squared first error
let sumD = 0
for (var i = 0; i < len - 2; i++) {
	sumD += Math.pow(residual(i + 1) - residual(i), 2)
	sumD = sumD || 0
}

//Sum of squared all difference error
let sumE = 0
for (var i = 0; i < len - 1; i++) {
	sumE += Math.pow(residual(i), 2)
	sumE = sumE || 0
}

//Durbin Watson statistic (0-4)
variable.DW = sumD / sumE

//Upper and lower threshold 
variable.upper = 4 - getUL(len)
variable.lower = getUL(len)

//NaN -> 0
variable.DW = variable.DW || 0
variable.upper = variable.upper || 0
variable.lower = variable.lower || 0


